[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "uniprot"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "PREFIX up: <http://purl.uniprot.org/core/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?protein ?mnemonic ?fullName ?functionComment
WHERE {
  ?protein a up:Protein ;
           up:reviewed 1 ;
           up:organism <http://purl.uniprot.org/taxonomy/9606> ;
           up:mnemonic ?mnemonic ;
           up:annotation ?annot .
  ?annot a up:Function_Annotation ;
         rdfs:comment ?functionComment .
  ?functionComment bif:contains "'tumor suppressor'"
  OPTIONAL {
    ?protein up:recommendedName ?name .
    ?name up:fullName ?fullName .
  }
}
LIMIT 50"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "PREFIX up: <http://purl.uniprot.org/core/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT (COUNT(DISTINCT ?protein) as ?count)
WHERE {
  ?protein a up:Protein ;
           up:reviewed 1 ;
           up:organism <http://purl.uniprot.org/taxonomy/9606> ;
           up:annotation ?annot .
  ?annot a up:Function_Annotation ;
         rdfs:comment ?functionComment .
  ?functionComment bif:contains "'tumor suppressor'"
}"}}]

