PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?goTerm ?goLabel (COUNT(DISTINCT ?protein) as ?proteinCount)
WHERE {
  GRAPH <http://sparql.uniprot.org/uniprot> {
    ?protein a up:Protein ;
             up:reviewed 1 ;
             up:organism <http://purl.uniprot.org/taxonomy/9606> ;
             up:classifiedWith ?goTerm .
  }
  GRAPH <http://sparql.uniprot.org/go> {
    ?goTerm rdfs:label ?goLabel .
    ?goLabel bif:contains "'autophagy'"
  }
}
GROUP BY ?goTerm ?goLabel
ORDER BY DESC(?proteinCount)
LIMIT 20"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "PREFIX up: <http://purl.uniprot.org/core/>
