LIMIT 10"}}]

[{"name": "mcp__togomcp__ncbi_esearch", "input": {"database": "clinvar", "query": "conflicting interpretations of pathogenicity", "max_results": 20}}, {"name": "mcp__togomcp__ncbi_esummary", "input": {"database": "clinvar", "ids": ["4531382", "2671573", "2628599", "2181706", "1805838"]}}, {"name": "mcp__togomcp__ncbi_esearch", "input": {"database": "clinvar", "query": "conflicting classifications[Review Status]", "max_results": 20}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "clinvar"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "clinvar", "sparql_query": "PREFIX cvo: <http://purl.jp/bio/10/clinvar/>

SELECT ?variant ?label ?review_status ?num_submitters
FROM <http://rdfportal.org/dataset/clinvar>
WHERE {
  ?variant a cvo:VariationArchiveType ;
           rdfs:label ?label ;
           cvo:number_of_submitters ?num_submitters ;
           cvo:classified_record ?classrec .
  ?classrec cvo:classifications/cvo:germline_classification/cvo:review_status ?review_status .
  FILTER(?num_submitters >= 2)
  FILTER(CONTAINS(LCASE(?review_status), "conflict"))
}
ORDER BY DESC(?num_submitters)
LIMIT 50"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "clinvar", "sparql_query": "PREFIX cvo: <http://purl.jp/bio/10/clinvar/>

